BAANOOL Car: real-time positioning of movable objects, regional location management, timely detection of abnormal vehicle status and reporting of alarm information. The module is used in conjunction with the BAANOOL car tracker series products, and has the following main functions:
1. Authorized phone: After the product is bound, the authorized number added in "Control" can communicate with the device, and a stranger with an unauthorized number will directly hang up;
2. Positioning: Real-time view of the device's location, movement information, and abnormal status, so that users can feel more at ease;
3. Equipment tracking: Track the equipment, draw the motion curve, and load the motion status information of each position;
4. Track playback: Retrieve the time and date, replay the route that has been taken, and dynamically play each segment of the device's motion track;
5. Device control: The application can directly issue control commands to the vehicle, breaking the cumbersome rules of control via SMS.
6. Electronic fence: multi-style area setting for the equipment, the exit/entry area will generate a response alarm to the platform display.
7. Report management: Visually display data in the form of charts and visually display changes in product data information;

BAANOOL Watch: Keep your kids safe, have unlimited communication with kids on the phone and talk, and make calls! No matter where you are, a phone can find you right away! This app is used in conjunction with BAANOOL phone watches, mainly as follows Big function:
1. Telephone: Those who have been bound to the watch and those added to the address book can communicate with each other, and turn on to reject calls from strangers to ensure the safety of children;
2. Positioning: check the child's position in real time, so that parents can feel more at ease;
3. Language chat: real-time voice chat, more convenient communication with children, making family relationships more intimate and harmonious;
4. Disabled in class: Disabled in class, only check the time, so that children can concentrate on learning at ease;
5. Guardian of school: guard children's safety in real time when they go to school.
6. Make friends with the watch: You can add friends between the watches by shaking them, and you can chat with friends in words;

BAANOOL Pet: Real-time control of the pet's location, give orders online, set the pet's safe activity range, listen to the sounds around the pet, and share pet experience with more pet friends. This app is used in conjunction with the BAANOOL pet ring, and has the following major functions

1. Propaganda: Send the owner's voice to the device through app recording, so that the pet can hear the owner's voice;
2. Listen: listen to the pet's voice to make communication easier;
3. Go home: record the voice of going home and send it with one button, so that the pet can quickly fly to the owner after hearing it;
4. Punishment: If the pet is disobedient, the owner can give the pet an electric shock punishment (safe electric shock);
5. Positioning: real-time view pet's location information to help quickly retrieve lost pets.
6. Wechat: In the nearby pets, you can add pet friends, start the pet communication mode together, and find the pet in your heart.

